// src/components/ReachOutNow.jsx
import React, { Component } from 'react';
import { FiMail } from 'react-icons/fi';
import './ReachOutNow.css';

export default class ReachOutNow extends Component {
  handleClick = () => {
    const gmailUrl =
      'https://mail.google.com/mail/?view=cm&fs=1&to=lamboferrari2025@gmail.com';
    window.open(gmailUrl, '_blank', 'noopener');
  };

  render() {
    return (
      <div className="reachout-container">
        <button
          className="reachout-toggle"
          onClick={this.handleClick}
          aria-label="Reach Out Now"
        >
          <FiMail size={28} strokeWidth={2.3} color="#000" />
        </button>
      </div>
    );
  }
}
